// this code automatically generates the referral exclusion list
// this list will be the dealer website url and the express store url
// https://www.simoahava.com/gtm-tips/implement-referral-exclusions-via-gtm/

function() {
  var excludeSites = {{roadsterCrossDomainAutoLink}}.split(',') || [];
  excludeSites.push('http://roadsterlocal.com');
  var hname = new RegExp('https?://([^/:]+)').exec({{Referrer}});
  if (hname) { 
    for (var i = excludeSites.length; i--;) {
      if (new RegExp(excludeSites[i] + '$').test(hname[1])) {
        return null;
      }
    }
  }
  return {{Referrer}};
}

